prompt --application/shared_components/automations/reset_user_info
begin
wwv_flow_imp_shared.create_automation(
 p_id=>wwv_flow_imp.id(10600924726740013572)
,p_name=>'reset user info'
,p_static_id=>'reset-user-info'
,p_trigger_type=>'POLLING'
,p_polling_interval=>'FREQ=DAILY;INTERVAL=1;BYHOUR=3;BYMINUTE=0'
,p_polling_status=>'ACTIVE'
,p_result_type=>'ALWAYS'
,p_use_local_sync_table=>false
,p_query_type=>'SQL'
,p_include_rowid_column=>false
,p_pk_column_name=>'USER_ID'
,p_commit_each_row=>false
,p_error_handling_type=>'IGNORE'
);
wwv_flow_imp_shared.create_automation_action(
 p_id=>wwv_flow_imp.id(10600925014280013575)
,p_automation_id=>wwv_flow_imp.id(10600924726740013572)
,p_name=>'delete from user info table'
,p_execution_sequence=>10
,p_action_type=>'NATIVE_PLSQL'
,p_action_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'UPDATE user_info set EXPIRED_Y_N = ''Y''',
'WHERE CREATED <= SYSTIMESTAMP - 7;'))
,p_action_clob_language=>'PLSQL'
,p_location=>'LOCAL'
,p_stop_execution_on_error=>true
);
end;
